import React from 'react';
import { Marker, Callout } from 'react-native-maps';
import { Text, View, Button } from 'react-native';

export default function SalonMarker({ salon }: { salon: any }) {
  const { location, name, queue } = salon;

  return (
    <Marker
      coordinate={{ latitude: location.latitude, longitude: location.longitude }}
      pinColor={queue === 0 ? 'green' : queue < 5 ? 'orange' : 'red'}
    >
      <Callout>
        <View style={{ width: 150 }}>
          <Text style={{ fontWeight: 'bold' }}>{name}</Text>
          <Text>Queue: {queue}</Text>
          <Button title="Navigate" onPress={() => { /* TODO: integrate deep link to maps */ }} />
        </View>
      </Callout>
    </Marker>
  );
}
